import './Home.css';

function Home() {
  return (
    <div className="Home">
        <div className='logo'>
            <img
                src="assets/logo.svg"
            />        

        </div>

        <div id='play-btn'></div>
        <div id='login-btn'></div>
        <div id='signin-btn'></div>
    </div>
  );
}

export default Home;
